import './Components.css';

const Navbar = ({ name }) => {

    return (
        <nav className="navbar bg-body-tertiary our-navbar">
        <div className="container-fluid d-flex justify-content-between align-items-center">
          <span className="navbar-text">
            {name}
          </span>
          <img src="../../" alt="Logo" />
        </div>
      </nav>
    )
}

export default Navbar
